    'Advanced settings in [1][2]Quantities[/1]' => 'Išplėstiniai nustatymai [1][2]Kiekiuose[/1]',
    'This is the retail price at which you intend to sell this product to your customers. The tax included price will change according to the tax rule you select.' => 'Tai mažmeninė kaina, už kurią ketinate parduoti šią prekę savo pirkėjams. Kaina su mokesčiais keisis pagal parinktas mokesčių taisykles.',
