    'The full filename with its extension (e.g. Book.pdf)' => 'Pilnas pavadinimas su plėtiniu (pvz., Knyga.pdf)',
    'Number of downloads allowed per customer. Set to 0 for unlimited downloads.' => 'Leistinas parsisiuntimų skaičius kiekvienam vartotojui. Nustatykite 0 neribotiems atsisiuntimams.',
    'If set, the file will not be downloadable after this date. Leave blank if you do not wish to attach an expiration date.' => 'Jei nurodyta, failas bus nepasiekiamas parsisiuntimui po šios datos. Palikite lauką tuščią jei nenorite nustatyti galiojimo pabaigos datos.',
    'This is the price at which you intend to sell this product to your customers. The tax included price will change according to the tax rule you select.' => 'Tai yra kaina, už kurią ketinate parduoti šią prekę savo klientams. Kaina su mokesčiais keisis pagal parinktas mokesčių taisykles.',
    'Some products can be purchased by unit (per bottle, per pound, etc.),  and this is the price for one unit. For instance, if you’re selling fabrics, it would be the price per meter.' => 'Kai kurios prekės gali būti parduodamos vienetais (buteliais, kilogramais, t.t.) ir tai yra kaina už 1 vnt. Pavyzdžiui, jei jūs parduodate audinius, tai būtų kaina už 1 metrą.',
    'The cost price is the price you paid for the product. Do not include the tax. It should be lower than the retail price: the difference between the two will be your margin.' => 'Savikaina - tai yra kaina, kurią jūs sumokate už prekę. Be mokesčių. Ji turėtų būti mažesnė nei mažmeninė kaina: skirtumas tarp jų bus jūsų marža.',
    'You can set specific prices for customers belonging to different groups, different countries, etc.' => 'Jūs galite nustatyti specifines kainas klientams, kurie priklauso skirtingoms grupėms, šalims ir pan.',
    'Sometimes one customer can fit into multiple price rules. Priorities allow you to define which rules apply first.' => 'Kartais vienas pirkėjas gali atitikti kelias kainos taisykles. Prioritetai leidžia jums nustatyti, kuri taisyklė bus taikoma pirkėjui.',
    'Tags are meant to help your customers find your products via the search bar.' => 'Gairės gali pagelbėti jūsų pirkėjams rasti prekes, naudojantis paieškos juosta.',
    'Choose terms and keywords that your customers will use to search for this product and make sure you are consistent with the tags you may have already used.' => 'Pasirinkite terminus ir raktažodžius, kuriuos naudoja jūsų klientai ieškodami šios prekės, ir įsitikinkite, ar jos yra suderintos su gairėmis, kurias naudojate.',
    'You can manage tag aliases in the [1]Search section[/1].' => 'Galite valdyti gairių alternatyvius vardus [1]Paieškos skyriuje[/1].',
    'Not all shops sell new products. This option enables you to indicate the condition of the product. It can be required on some marketplaces.' => 'Ne visos parduotuvės parduoda naujas prekes. Ši parinktis leidžia jums nurodyti prekės būklę. Tai gali būti reikalinga kai kuriose prekyvietėse.',
    'ISBN is used internationally to identify books and their various editions.' => 'ISBN (Tarptautinis standartinis knygos numeris) yra naudojamas tarptautiniu mastu, kad būtų galima identifikuoti knygas ir jų įvairius leidimus.',
    'This type of product code is widely used in the United States, Canada, the United Kingdom, Australia, New Zealand and in other countries.' => 'Šis prekės kodas yra plačiai naudojamas JAV, Kanadoje, Jungtinėje Karalystėje, Australijoje, Naujojoje Zelandijoje ir kitose šalyse.',
    'Permanently delete this product.' => 'Visam laikui ištrinti šią prekę.',
    'Save and duplicate this product, then go to the new product: CTRL+D' => 'Išsaugokite ir kopijuokite prekę, tuomet eikite į naują prekę: CTRL+D',
    'Save and go back to the catalog: CTRL+Q' => 'Išsaugokite ir grįžkite atgal į katalogą: CTRL+O',
    'Save and create a new product: CTRL+P' => 'Išsaugokite ir sukurkite naują prekę: CTRL + P',
    'Save the product and stay on the current page: CTRL+S' => 'Išsaugokite prekę ir likite dabartiniame puslapyje: CTRL + S',
    'Upload a brand logo from your computer.' => 'Įkelkite prekės ženklo logotipą iš savo kompiuterio.',
    'To add "tags," click inside the field, write something, and then press "Enter."' => 'Norėdami pridėti "žymas", paspauskite ant lauko, įrašykite ką nors ir paspauskite "Enter".',
    'Company name for this brand' => 'Įmonės pavadinimas šiam prekės ženklui',
    'Company name for this supplier' => 'Įmonės pavadinimas šiam tiekėjui',
    'Will appear in the list of suppliers.' => 'Bus rodoma tiekėjų sąraše.',
    'Phone number for this supplier' => 'Šio tiekėjo telefono numeris',
    'Mobile phone number for this supplier.' => 'Šio tiekėjo mobilaus telefono numeris.',
    'Upload a supplier logo from your computer.' => 'Įkelkite tiekėjo logotipą iš savo kompiuterio.',
    'To add "tags" click in the field, write something and then press "Enter".' => 'Norėdami sukurti "žymas", spustelėkite laukelyje, ką nors parašykite ir paspauskite "Enter".',
    'Create a new product: CTRL+P' => 'Sukurti naują prekę: CTRL+P',
    'Search for a product' => 'Ieškoti prekės',
    'Enter your product name' => 'Įveskite prekės pavadinimą',
    'The summary is a short sentence describing your product.<br />It will appears at the top of your shop\'s product page, in product lists, and in search engines\' results page (so it\'s important for SEO). To give more details about your product, use the "Description" tab.' => 'Santrauka yra trumpi sakiniai, apibūdinantys jūsų prekę. <br />Jie bus matomi parduotuvės prekės puslapio viršuje, prekių sąrašuose ir paieškos sistemų rezultatų puslapiuose (todėl tai labai svarbu SEO). Įveskite daugiau informacijos apie savo prekę skirtukyje "Aprašymas".',
    'Search and add a related product' => 'Ieškoti ir pridėti susijusią prekę',
    'Use a comma to create seperate tags. E.g.: dress, cotton, party dresses.' => 'Naudokite kablelį, norėdami atskirti gaires. Pvz.: suknelė, medvilnė, kokteilinė suknelė.',
    'Per kilo, per litre' => 'Už kilogramą, už litrą',
    'Combine several attributes, e.g.: "Size: all", "Color: red".' => 'Kombinuoti skirtingus atributus, pvz.: "Dydis: visi", "Spalva: raudona".',
    'To have a different title from the product name, enter it here.' => 'Jei norite turėti skirtingą pavadinimą nei prekės pavadinimas, įveskite jį čia.',
    'To have a different description than your product summary in search results pages, write it here.' => 'Jei norite turėti skirtingą prekės santraukos aprašymą paieškos rezultatų puslapyje, rašykite jį čia.',
    'To which product the page should redirect?' => 'Į kurią prekę turi nukreipti puslapis?',
    'Search name' => 'Ieškoti pavadinimuose',
    'Search ref.' => 'Ieškoti koduose',
    'Search category' => 'Ieškoti kategorijoje',
    'The minimum quantity required to buy this product (set to 1 to disable this feature). E.g.: if set to 3, customers will be able to purchase the product only if they take at least 3 in quantity.' => 'Minimalus kiekis, būtinas norint įsigyti šią prekę (nurodžius 1 - parinktis išjungiama). Pvz.: jei nurodysite 3, pirkėjas galės įsigyti prekę, jei nurodys 3 prekės vnt.',
    'This type of product code is specific to Europe and Japan, but is widely used internationally. It is a superset of the UPC code: all products marked with an EAN will be accepted in North America.' => 'Šis prekės kodas yra specifinis Europai ir Japonijai, tačiau taip pat plačiai naudojamas kitur. Šis kodo standartas apima daugiau nei UPC kodo standartas: visos prekės, pažymėtos EAN kodu, bus priimtos ir Šiaurės Amerikoje.',
    'Does this combination have a different price? Is it cheaper or more expensive than the default retail price?' => 'Ar ši kombinacija turi skirtingą kainą? Tai mažesnė ar didesnė kaina negu numatytoji mažmeninė kaina?',
    'Where should the product be available on your site? The main category is where the product appears by default: this is the category which is seen in the product page\'s URL.' => 'Kur puslapyje turi būti matoma prekė? Pagrindinė kategorija yra prekės numatyta pagal nutylėjimą vieta: tai yra kategorija, kuri matoma prekės puslapio URL.',
    'Search categories' => 'Ieškoti kategorijose',
    'If you want to quickly create a new category, you can do it here. Don’t forget to then go to the Categories page to fill in the needed details (description, image, etc.).' => 'Jei norite greitai sukurti kategoriją, galite tą padaryti čia. Tik nepamirškite nueiti į kategorijų puslapį ir užpildykite reikiamą informaciją (aprašymas, paveiksliukai ir t.t.).',
    'This interface allows you to specify the suppliers of the current product and its combinations, if any.' => 'Ši sąsaja leidžia jums nurodyti tiekėjus šiai prekei ir jos deriniams, jei reikia.',
    'You can specify supplier references according to previously associated suppliers.' => 'Taip pat galite nurodyti tiekėjo nuorodą su anksčiau įvestais tiekėjais.',
    'When using the advanced stock management tool (see Shop Parameters > Products settings), the values you define (price, references) will be used in supply orders.' => 'Kai naudojamas išplėstinis atsargų valdymo įrankis (žiūrėkite Parduotuvės parametrai->Prekės nustatymai), vertės, kurias nurodote (kainos, kodai), bus naudojamos tiekimo užsakymuose.',
    'You can specify product reference(s) for each associated supplier. Click "Save" after changing selected suppliers to display the associated product references.' => 'Galite nurodyti prekės kodą pagal kiekvieną tiekėją. Paspauskite "Išsaugoti" po tiekėjo pasirinkimo, kad pamatytumėte susietą prekės kodą.',
    'This interface allows you to specify the warehouse in which the product is stocked.' => 'Ši sąsaja leidžia jums nurodyti sandėlį, kuriame laikoma prekė.',
    'It is also possible to specify the location within the warehouse for each product or combination.' => 'Taip pat galima nurodyti kiekvienos prekės ar derinio vietą sandėlio viduje.',
    'Combinations are the different variations of a product, with attributes like its size, weight or color taking different values. To create a combination, you need to create your product attributes first. Go to Catalog > Attributes & Features for this!' => 'Deriniai yra skirtingi prekių variantai, su tokiomis savybėmis kaip dydis, svoris ar spalva, atsižvelgiant į skirtingas reikšmes. Norėdami sukurti derinį, pirmiausia turite sukurti prekės atributus. Eikite į Katalogas > Savybės ir ypatybės!',
    'To add combinations, enter the wanted attributes (like "size" or "color") and their respective values ("XS", "red", "all", etc.) in the field below; or select it in the right column. Then click on "Generate": it will automatically create all the combinations for you! <br> If you haven’t got any attributes yet, you should first create some in [1]Attributes & Features[/1].' => 'Norėdami pridėti derinius, įveskite norimas savybes (pvz.: "dydis" arba "spalva") ir atitinkamas jų reikšmes ("XS", "raudonas", "visi" ir t.t.) žemiau esančiame lauke; arba pasirinkite juos stulpelyje dešinėje. Tuomet spauskite "generuoti": bus automatiškai sukurti deriniai jums! <br> Jei neturite jokių atributų, pirmiausia turite sukurti juos [1]Savybės ir ypatybės[/1].',
    'Public title for the product\'s page, and for search engines. Leave blank to use the product name. The number of remaining characters is displayed to the left of the field.' => 'Viešas pavadinimas prekės puslapiui ir paieškos sistemoms. Palikite tuščia, jei naudosite prekės pavadinimą. Likusių simbolių skaičius rodomas kairėje lauko pusėje.',
    'This description will appear in search engines. You need a single sentence, shorter than 160 characters (including spaces).' => 'Šis aprašymas bus rodomas paieškos varikliuose (jų rezultatų puslapiuose). Jums reikia įvesti vieną sakinį, trumpesnį nei 160 simbolių (tarpai įskaičiuoti).',
    'This is the human-readable URL, as generated from the product\'s name. You can change it if you want.' => 'Tai yra žmogui perskaitoma nuoroda, sugeneruota iš prekės pavadinimo.',
    'When your product is disabled, choose to which page you’d like to redirect the customers visiting its page.' => 'Kai prekė yra išjungta, pasirinkite, į kurį puslapį norite nukreipti lankytoją.',
    'No redirection (404) = Do not redirect anywhere and display a 404 "Not Found" page.' => 'Neperadresuota (404) = Niekur nenukreipti ir rodyti "404 Nieko nerasta" puslapį.',
    'Permanent redirection (301) = Permanently display another product instead.' => 'Nuolatinė nuoroda (301) = Nuolatos rodyti nuorodą į kitą prekę vietoj jos.',
    'Temporary redirection (302) = Temporarily display another product instead.' => 'Laikinas peradresavimas (302) =Laikinai rodyti kitą prekę vietoj jos.',
    'If a carrier has a tax, it will be added to the shipping fees.' => 'Jei kurjeris turi mokestį, jis bus pridėtas prie pristatymo išlaidų.',
    'Invalid token' => 'Neteisinga žyma',
    '[1]Invalid token[/1]: direct access to this link may lead to a potential security breach.' => '[1]Neteisingas prieigos raktas[/1]: tiesioginė prieiga prie šios nuorodos gali sukelti galimą saugumo pažeidimą.',
    'Do you want to display this page?' => 'Ar norite rodyti šį puslapį?',
    'Yes, I understand the risks' => 'Taip, aš suprantu riziką',
    'Take me out of there!' => 'Išveskite mane iš čia!',
  ),
