  'AdminDashboardHelp' => 
  array (
    'This mode displays sample data so you can try your dashboard without real numbers.' => 'Šis rėžimas rodo testinius duomenis, kad jūs galėtumėte išbandyti skydelį be tikrtų duomenų.',
    'Choose a fixed fee for each order placed in %currency% with %module%.' => 'Pasirinkite fiksuotą mokestį kiekvienam užsakymui, pateiktam %currency% su %module%.',
    'Choose a variable fee for each order placed in %currency% with %module%. It will be applied on the total paid with taxes.' => 'Pasirinkite kintamą mokestį kiekvienam užsakymui, pateiktam %currency% su %module%. Tai bus taikoma visai sumai, sumokėtai su mokesčiais.',
    'Choose a fixed fee for each order placed with a foreign currency with %module%.' => 'Pasirinkite fiksuotą mokestį kiekvienam užsakymui, atliktam užsienio valiuta su %module%.',
    'Choose a variable fee for each order placed with a foreign currency with %module%. It will be applied on the total paid with taxes.' => 'Pasirinkite kintamą mokestį kiekvienam užsakymui, pateiktam užsienio valiuta su %module%. Tai bus taikoma visai sumai, sumokėtai su mokesčiais.',
    'For the carrier named %s, indicate the domestic delivery costs  in percentage of the price charged to customers.' => 'Kurjeriui, kurio pavadinimas %s, rodyti vietinio pristatymo kainas procentais (nuo bendros mokėtos sumos).',
    'For the carrier named %s, indicate the overseas delivery costs in percentage of the price charged to customers.' => 'Kurjeriui, kurio pavadinimas %s, rodyti užsienio pristatymo kainas procentais (nuo bendros mokėtos sumos).',
    'Method: Indicate the percentage of your carrier margin. For example, if you charge $10 of shipping fees to your customer for each shipment, but you really pay $4 to this carrier, then you should indicate "40" in the percentage field.' => 'Būdas: rodyti bendrąjį pelną kurjerio įkainiams. Pvz. jei jūs imate 10$ už pristatymą iš pirkėjo, o realiai jums pristatymas kainuoja tik 4$, tai tuomet jūs procentų lauke turėtumėte nurodyti "40".',
    'You should calculate this percentage as follows: ((total sales revenue) - (cost of goods sold)) / (total sales revenue) * 100. This value is only used to calculate the Dashboard approximate gross margin, if you do not specify the wholesale price for each product.' => 'Turėtumėte apskaičiuoti šią procentinę dalį taip: ((visos pardavimų pajamos) - (prekių savikaina)) / (visos pardavimų pajamos) * 100. Šis dydis naudojamas skydelyje apytiksliai apskaičiuoti bendrąjį pelną, jei jūs nenurodote didmeninės kainos kiekvienai prekei.',
    'You should calculate this value by making the sum of all of your additional costs per order.' => 'Šią reikšmę paskaičiuokite sudėję visas papildomas išlaidas kiekviename užsakyme.',
  ),
