    'With all of the great features and benefits that PrestaShop offers, it\'s important to keep up!' => 'Labai svarbu sekti ir mokėti naudotis visomis naujausiomis PrestaShop galimybėmis!',
    'The main goal of all of the features we offer is to make you succeed in the e-commerce world. In order to accomplish this, we have created a system of badges and points that make it easy to monitor your progress as a merchant. We have broken down the system into three levels, all of which are integral to success in the e-commerce world: (i) Your use of key e-commerce features on your store; (ii) Your sales performance; (iii) Your presence in international markets.' => 'Pagrindinė savybių, kurias mes siūlome, paskirtis yra padėti jums tapti sėkmingu el. komercijos pasaulyje. Tam, kad pasiekti tai, mes sukūrėme ženkliukų ir taškų sistemą, kurie padės jums sekti savo progresą tampant prekybiniku. Sistemą suskirtėme į tris skirtingus lygius, kurie yra būtini pasiekti sėkmei el. komercijoje: (i) Pagr. el. komercijos funckijų panaudojimas jūsų parduotuvėje; (ii) Jūsų pardavimai; (iii) Jūsų veikla tarptautinėse rinkose.',
    'The more progress your store makes, the more badges and points you earn. No need to submit any information or fill out any forms; we know how busy you are, everything is automatic!' => 'Kuo didesnę pažangą atliksite savo parduotuvėje, tuo daugiau surinksite taškų ir ženkliukų. Jums nereikės siųsti jokios informacijos ar pildyti kokių nors formų; mes žinome, kas jūs esate užsiėmę, viskas yra automatizuota!',
