    'In your Back Office, you can modify the following order statuses: Awaiting Check Payment, Payment Accepted, Preparation in Progress, Shipping, Delivered, Canceled, Refund, Payment Error, Out of Stock, and Awaiting Bank Wire Payment.' => 'Administracinėje dalyje galite keisti šias užsakymo būsenas: Laukiama apmokėjimo čekiu, Apmokėjimas priimtas, Vyksta paruošimas, Išsiųsta, Pristatyta, Atšaukta, Grąžinimas, Apmokėjimo klaida, Išparduota ir Laukiamas mokėjimas bankiniu pavedimu.',
