    'Making sure that your website is accessible to as many people as possible' => 'Įsitikinkite, kad Jūsų svetainė yra prieinama visiems žmonėms, kiek įmanoma',
    'When managing a website, it is important to keep track of the software used by visitors so as to be sure that the site displays the same way for everyone. PrestaShop was built to be compatible with the most recent Web browsers and computer operating systems (OS). However, because you may end up adding advanced features to your website or even modifying the core PrestaShop code, these additions may not be accessible to everyone. That is why it is a good idea to keep track of the percentage of users for each type of software before adding or changing something that only a limited number of users will be able to access.' => 'Valdant svetainę yra svarbu sekti, kokią programinę įrangą naudoja lankytojai, kad būtumėte įsitikinę, kad svetainė rodo tą patį kelią kiekvienam.  PrestaShop buvo sukurta taip, kad būtų suderinama su naujausiomis tinklo naršyklėmis ir kompiuterių operacinėmis sistemomis (OS). Tačiau, kadangi Jūs galite pridėti papildomų funkcijų į savo svetainę ar net pakeisti pagrindinį PrestaShop kodą, šie papildymai gali būti neprieinami kiekvienam. Štai todėl yra gera idėja sekti kiekvienos programinės įrangos vartotojų procentą prieš pridedant ar kažką keičiant svetainėje, ko pasekoje būtų limituotas vartotojų, turinčių prieigą, skaičius.',
