    'The total number of accounts created is not in itself important information. However, it is beneficial to analyze the number created over time. This will indicate whether or not things are on the right track. You feel me?' => 'Sukurtų paskyrų skaičius pats savaime nėra svarbi informacija. Tačiau yra naudinga panagrinėti sukurtų paskyrų skaičių per laiko tarpą. Tai parodys ar reikalai eina teisinga linkme. Ar ne?',
