    'Here is a summary of what may affect the creation of customer accounts:' => 'Tai yra sąvadas priežasčių, kurios galėjo įtakoti pirkėjų paskyrų kūrimą:',
    'An advertising campaign can attract an increased number of visitors to your online store. This will likely be followed by an increase in customer accounts and profit margins, which will depend on customer "quality." Well-targeted advertising is typically more effective than large-scale advertising... and it\'s cheaper too!' => 'Reklamos kampanija gali pritraukti didesnį lankytojų skaičių į Jūsų parduotuvę. Tai greičiausiai bus įtakojama klientų paskyrų ir pelno maržos padidėjimo, kurie priklauso nuo klientų "kokybės". Kontekstinės reklamos paprastai yra efektyvesnės nei didelio mąsto reklamos...ir tai yra pigiau!',
    'Specials, sales, promotions and/or contests typically demand a shoppers\' attentions. Offering such things will not only keep your business lively, it will also increase traffic, build customer loyalty and genuinely change your current e-commerce philosophy.' => 'Spec. pasiūlymai, išpardavimai, akcijos ir/ar konkursai paprastai reikalauja pirkėjų dėmesio. Siūlant tokius dalykus ne tik išlaikomas verslas "gyvas", bet ir padidinama prekyba, kuriamas klientų lojalumą ir iš esmės pakeičiama Jūsų dabartinę e-komercijos filosofiją.',
