    'This is where you decide what payment modules are available for different variations like your customers\' currency, group, and country.' => 'Čia jūs nuspręsite kurie mokėjimo moduliai yra galimi skirtingiems variantams, pvz., jūsų vartotojų valiuta, grupė ar šalis.',
