    'Save restrictions' => 'Išsaugoti ribojimus',
    'Indexing' => 'Indeksavimas',
    'There is a huge quantity of data, so each connection corresponding to a referrer is indexed. You can also refresh this index by clicking the "Refresh index" button. This process may take a while, and it\'s only needed if you modified or added a referrer, or if you want changes to be retroactive.' => 'Tai yra labai didelis duomenų kiekis, kadangi kiekvieno prisijungimo referer yra išsaugomas. Jūs taip pat galite atnaujinti šį indeksą paspaudę aukščiau esantį mygtuką. Procesas gali užtrukti kurį laiką ir jis reikalingas tik jeigu jūs pakeitėte ar pridėjote "referer", arba jūs norite kad pakeitimai būtų "retroactive".',
    'Refresh index' => 'Atnaujinti indeksą',
    'Cache' => 'Spartinančioji atmintis',
    'Your data is cached in order to sort it and filter it. You can refresh the cache by clicking on the "Refresh cache" button.' => 'Jūsų duomenys yra kešuojami tam, kad juos būtų galima rikiuoti ir filtruoti. Jūs galite atnaujinti spartinančiąją atmintį paspausdami "Atnaujinti spartinančiąją atmintį" mygtuką.',
    'Refresh cache' => 'Atnaujinti spartinančią atmintį',
    'Direct traffic can be quite resource-intensive. You should consider enabling it only if you have a strong need for it.' => 'Tiesioginis srautas gali būti imlus resursams. Jūs turėtumėte jį įjungti tik jei jums tikrai to reikia.',
    'Save direct traffic?' => 'Išsaugoti tiesioginį srautą',
    'The module \'%s\' must be activated and configurated in order to have all the statistics' => 'Modulis \'%s\'  turi būti aktyvuotas ir sukonfigūruotas, jei norite turėti visas statistikas',
    'Show me more' => 'Rodyti daugiau',
    'Definitions:' => 'Sąvokos:',
    'The "http_referer" field is the website from which your customers arrive.' => 'Laukas "http_referer" yra svetainė, iš kurios jūsų atkeliavo jūsų lankytojai.',
    'For example, visitors coming from Google will have an "http_referer" value like this one: "http://www.google.com/search?q=prestashop".' => 'Pavyzdžiui, lankytojai, ateinantys iš Google svetainės, turės "http_referer" lauko reikšmę tokią: "http://www.google.com/search?q=prestashop".',
    'If the visitor arrives directly (by typing the URL of your shop, or by using their bookmarks, for example), the http_referer will be empty.' => 'Jei vartotojas ateina tiesiogiai (pvz., įvesdamas adresą naršyklės lange), tai laukas \'http_referer\' bus tuščias.',
    'If you\'d like to view all the visitors coming from Google, you can type "%google%" in this field. Alternatively, you can type "%google.fr%" if you want to view visitors coming from Google France, only.' => 'Taigi, jei norite visų lankytojų iš Google, įrašykite laukelyje \\"%google%\\" arba \\"%google.lt%\\" jei norite tik Google.lt lankytojų.',
    'The "request_uri" field is the URL from which the customers come to your website.' => 'Laukas \'request_uri\' yra URL, iš kurio jūsų lankytojai ateina į jūsų svetainę.',
    'For example, if the visitor accesses a product page, the URL will be like this one: "%smusic-ipods/1-ipod-nano.html".' => 'Pavyzdžiui, jei lankytojas įeina į prekės puslapį, tai URL bus toks: "%smusic-ipods/1-ipod-nano.html".',
    'This is helpful because you can add tags or tokens in the links pointing to your website.' => 'Tai yra naudinga, nes galite pridėti žymas arba raktus į nuorodas, kurios veda į jūsų interneto svetainę.',
    'For example, you can post a link (such as "%sindex.php?myuniquekeyword" -- note that you added "?myuniquekeyword" at the end of the URL) in an online forum or as a blog comment, and get visitors statistics for that unique link by entering "%%myuniquekeyword" in the "request_uri" field.' => 'Pavyzdžiui, jūs galite palikti nuorodą (tokią kaip "%sindex.php?myuniquekeyword" - atkreipkite dėmesį į pridėtą "?myuniquekeyword" URL gale) forume arba tinklaraščio komentaruose, tokiu būdų gaunant lankytojų statistiką iš tos unikalios nuorodos - įvedant "%%myuniquekeyword" į "request_uri" (užklausos_uri) lauką.',
    'This method is more reliable than the "http_referer" one, but there is one disadvantage: if a search engine references a page with your link, then it will be displayed in the search results and you will not only indicate visitors from the places where you posted the link, but also those from the search engines that picked up that link.' => 'Šis metodas yra labiau patikimas nei "http_referer" metodas, bet yra vienas trūkumas: jei paieškos variklis aptiks jūsų nuorodą, ji bus rodoma paieškos rezultatuose ir jūs gausite lankytojų srautą ir paieškos rezultatų, bet ne iš to puslapio, kuriame palikote nuorodą.',
    'The "Include" fields indicate what has to be included in the URL.' => 'Laukai "įtraukti" (angl. "include") nurodo, kas turi būti įtraukta į URL.',
    'The "Exclude" fields indicate what has to be excluded from the URL.' => 'Laukas "Exclude" nurodo, ką reikia šalinti iš URL.',
    'When using simple mode, you can use a wide variety of generic characters to replace other characters:' => 'Naudojant supaprastintą režimą, galite naudoti specifinius ženklus, kurie gali pakeisti kitus simbolius:',
