    '%" will replace any number of characters. If you want to use the real "%", you should type this: "\\\\%".' => '"%" pakeis bet kiek simbolių. Jei norite naudoti "%" kaip simbolį, jį įveskite taip: "\\\\%".',
    'The Simple mode uses the MySQL "LIKE" pattern matching, but for a higher potency you can use MySQL\'s regular expressions in the Expert mode.' => 'Supaprastintas rėžimas naudoja MySQL "LIKE" komanda tekstų lyginimui, tačiau eksperto rėžime jūs galite naudoti galingesnes RegEx komandas.',
